import styled from "styled-components";
import { BlockHeader } from "../basic/BlockHeader";

const FormContainer = styled.div`
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);

    width: 574px;
    height: auto;
`

export const InitialForm = () => {
    return(<>
        <FormContainer>
            <BlockHeader/>
        </FormContainer>
    </>)
}
